desc:
Once per turn: You can target 1 Ritual Monster you control; show 1 Ritual Monster in your hand, until the end of this turn. The Level of the shown Ritual Monster becomes the targeted monster's Level, until the end of this turn (even if this card leaves the field). Once per turn, if "Ruin, Queen of Oblivion" or "Demise, King of Armageddon" is Ritual Summoned to your field (except during the Damage Step): You can activate 1 of these effects;
● Draw 1 card.
● Destroy 1 card on the field.

When this card is activated: Place 1 counter on it. Once per turn, during your Standby Phase: Place 1 counter on this card. Once per turn: You can activate 1 of these effects;
● Gain 500 LP for each counter on this card.
● Inflict 300 damage to your opponent for each counter on this card.

Once per turn: You can discard 1 card, then activate 1 of these effects;
● Add 1 Level 4 or lower "Dragunity" monster from your Deck to your hand.
● Send 1 Dragon monster from your Deck to the GY.

If you control a Dragon monster: Activate 1 of these effects;
● Inflict 800 damage to your opponent.
● Target 1 monster with 800 or less DEF; destroy that target.

If you control "Jinzo": Activate 1 of these effects;
● All Machine monsters you currently control cannot be destroyed by your opponent's card effects, until the end of this turn.
● When a card or effect is activated that targets a Machine monster(s) you control: Negate that effect.

Activate 1 of these effects;
● All monsters your opponent controls lose 500 ATK for each Ritual Monster on the field, until the end of this turn.
● Ritual Summon 1 "Megalith" Ritual Monster from your Deck in Defense Position, by Tributing monsters from your hand or field whose total Levels equal exactly twice its Level.

Activate 1 of these effects;
● Gain 1200 LP.
● Inflict 800 damage to your opponent.

To activate this card, you must draw it for your normal draw in your Draw Phase, reveal it, and keep it revealed until the Main Phase 1. During your Main Phase 1 that same turn: You can target 1 "Utopia" Xyz Monster you control, then activate 1 of these effects;
● Equip any number of "ZW -" monsters with different names from your Deck/Extra Deck to it.
● Special Summon from your Extra Deck, 1 "Utopia" Xyz Monster with a different name from that target, by using that target as material. (This is treated as an Xyz Summon. Transfer its materials to the Summoned monster.)

Target 1 Spellcaster monster on the field, then activate 1 of these effects;
● That face-up monster is unaffected by other Spell effects this turn.
● That face-up monster is unaffected by Trap effects this turn.

Activate 1 of these effects;
● If you control an "Odd-Eyes" card: Target 1 card on the field; destroy it.
● Add to your hand, 1 Level 7 "Odd-Eyes" monster from your Deck, or 1 face-up Level 7 "Odd-Eyes" Pendulum Monster from your Extra Deck.

Target 1 face-up monster on the field and activate 1 of these effects;
● Increase that target's Level by 1.
● Reduce that target's Level by 1.

Equip only to a "Gusto" monster. The equipped monster cannot be destroyed by your opponent's card effects. You can only use each of the following effects of "Tailwind of Gusto" once per turn. You can banish this card from your GY and discard 1 WIND monster; add 1 "Gusto" Spell/Trap from your Deck to your hand. You can activate this effect based on the Level/Rank of the equipped monster;
● 4 or lower: Special Summon 1 "Gusto" monster from your Deck with a different Type than the equipped monster.
● 5 or higher: Special Summon 1 Level 1 Tuner from your Deck.

If your opponent Special Summons a Ritual, Fusion, Synchro, Xyz, or Link Monster(s) (except during the Damage Step): You can activate 1 of these effects (but you can only use each effect of "The Boundless Open Land" once per turn);
● Add 1 "Fallen of Albaz", or 1 monster that mentions it, from your Deck to your hand.
● Special Summon 1 "Fallen of Albaz", or 1 monster that mentions it, from your hand.

You take no battle damage from attacks involving your co-linked monsters. Once per turn: You can activate 1 of these effects;
● Move 1 "Knightmare" monster you control to another of your Main Monster Zones.
● Switch the locations of 2 "Knightmare" monsters in your Main Monster Zones.
